import ast


def decode_hex_structure(hex_structure):
  def decode_element(element):
    if isinstance(element, list):
      return ''.join(decode_element(sub_element) for sub_element in element)
    elif isinstance(element, str):
      return chr(int(element, 16))
    return ''

  return decode_element(hex_structure)

